import React, { Component } from 'react';
import { Menu, Icon } from 'antd';
import { Route, NavLink, Switch } from 'react-router-dom';

class LeftMenu extends Component {
  render() {
    return (
   <div>
      <li>
          <NavLink to = "/interview-corner"><a href=""  style = {{ color: "grey" }}>Interviews</a></NavLink>
      </li>
      <li>
      <NavLink to = "/new-jobs/" exact ><a href=""  style = {{ color: "grey" }}>
        New Job Openings</a></NavLink></li>
      <ul className = "dropdown-menu">  
        <li className="dropdown-header" style = {{ color: "grey" }}>Test Skills
            <li>
              <a href="" style = {{ color: "grey" }}>Aptitude</a>
            </li>
            <li>
              <a href="" style = {{ color: "grey" }}>Technical</a>
            </li>
        </li>
      </ul>
      <li>
        <NavLink to = "/interviews/new" exact>
          <a href=""  style = {{ color: "grey" }}>Add Interview</a>
        </NavLink>
      </li>
    </div>
    );
  }
}
export default LeftMenu;
